import React, { Component } from 'react'

class DailyGoals extends Component {
    render() {
        const dailyTodos = [
            {
              id: 1,
              title: 'Programme',
              daysChecked: 20,
              onDay: 25,
              totaldays: 30,
              thisWeek:[true, false, true, true, false, null, null]
            },
            {
              id: 2,
              title: 'Study React',
              daysChecked: 3,
              onDay: 7,
              totaldays: 30,
              thisWeek:[true, false, true, true, false, null, null]
            },
            {
              id: 3,
              title: 'Do Stuff',
              daysChecked: 20,
              onDay: 25,
              totaldays: 30,
              thisWeek:[false, false, false, false, false, null, null]
            }
          ]
        const displayTodos = dailyTodos.map(todo => {
            return(
                <div className="onedailygoal">
                    <div className="onedailygoalheading">
                        <h4>{todo.title} </h4>123
                    </div>
                </div> 
            )
        })

        return (
            <div className="onedailygoal">
                <div className="onedailygoalheading">
                <h4>test </h4>123
                </div>
            </div> 
        )
    }
}

export default DailyGoals
